import React from "react";
import "../../../styles/index.scss";


const Button = ({onClick, className, buttonTittle}: {onClick: ()=>void, className: string, buttonTittle: string}) => {

    return(
        <button type='button' className={className} onClick={onClick}>{buttonTittle}</button>
    );
}

export default Button;
